import React, {useEffect} from "react";
import Navbar from "./Navbar";
import Intro from "./Intro";
import History from "./History";
import Skills from "./Skills";


function App() {

  return (
    <div className="App">
      <Navbar/>
      <header className="App-header">
      </header>
      <div>
      <Intro />
      </div>
      <History />
      <Skills />
    </div>
  );
}

export default App;
